export function getRandomCards(count) {
    const result = [];
    for (let i = 0; i < count; i++) {
        result.push({
            ...SAMPLE_CARDS[Math.floor(Math.random() * SAMPLE_CARDS.length)],
            id: `${SAMPLE_CARDS[Math.floor(Math.random() * SAMPLE_CARDS.length)].id}_${Math.random()}`,
        });
    }
    return result;
}
